import { Navigate, Route } from "react-router-dom";
import useAuth from "../hooks/useAuth";


export default  function PrivateRoute ({component: Component, ...rest}) {
   const auth = useAuth(); 

    return <Route {...rest}>{auth ? children : <Navigate to ='/login'/> }</Route>;

}
